import React, { Component } from "react";
import "./App.css";
import { isMobile } from "./utils.js";
import Project from "./project.js";

class Projects extends Component {
  render() {
    let projects = [
      [
        "Logo Design",
        "Creating coroporate logos for real + imaginary companies",
        "http://asherdawson.org/logo-design",
        "/logo_van.png",
        "2018",
        "truck"
      ],
      [
        "Salad Bowl App",
        "Timer & score keeper",
        "http://saladbowlapp.com/",
        "/logo_saladbowl.png",
        "2018",
        "globe"
      ],
      [
        "Halo",
        "Internal operations platform for SV Angel",
        null,
        "/logo_halo.png",
        "2017-18",
        "globe"
      ],
      [
        "Jotpocket",
        "Notes & pics, fast af",
        "https://itunes.apple.com/us/app/jotpocket/id1109911349?mt=8",
        "/logo_jotpocket.png",
        "2016",
        "mobile alternate"
      ],
      [
        "HailMe",
        "Make your phone a billboard",
        "https://itunes.apple.com/us/app/hailme/id956407355?mt=8",
        "/logo_hailme.png",
        "2015",
        "mobile alternate"
      ],
      [
        "TD4W",
        "A party in your pocket",
        "https://itunes.apple.com/us/app/td4w-turn-down-for-what/id912651703?mt=8",
        "/logo_td4w.png",
        "2014",
        "mobile alternate"
      ]
    ];
    return (
      <div className={"ui " + (isMobile() ? "" : "padded") + " grid"}>
        {projects.map(i => {
          return (
            <Project
              key={i[0]}
              name={i[0]}
              desc={i[1]}
              url={i[2]}
              img={i[3]}
              date={i[4]}
              icon={i[5]}
            />
          );
        })}
      </div>
    );
  }
}

export default Projects;
